import React, { Component } from 'react'
import Layout from '../components/layout.js'
import { Jumbotron, Button, Media } from 'reactstrap'
import 'bootstrap/dist/css/bootstrap.min.css'


const AvatarStyle = {
    borderRadius: '50%',
    width: '200px',
    height: '200px'
};

const Example = (props) => {
    return (
      <div>
        <Jumbotron>
          <h1 className="display-3 text-center">Welcome to my page!</h1>
            <div className="container-fluid bg-1 text-center">
                <img src="../static/images/avatar.jpg" className="img-responsive img-circle margin" style={AvatarStyle} alt="Bird"/>
            </div>
          <p className="lead text-center">
                This page has been created during my efforts to learn JavaScript 
                and the React development structure.
          </p>
          <hr className="lead text-center" />
            <p>
                It is my intent to use this page as a professional page and portfolio as
                I progress as a developer.<br />
                Please feel free to look around and email me with any questions or suggestions.
            </p>
          
        </Jumbotron>
      </div>
    );
  };


const pStyle = {
    marginRight: 'Auto',
    marginLeft: 'Auto',
    lineHeight: 3,
    width: '800px',
}

class Home extends Component {
    render() {
        return (
            <Layout>
                <div>
                <div>
                <Example />
                
                </div>
                
                
                </div>
            </Layout>
        );
    }
}


export default Home;
